const currencyLoaded = (currency, v2) => {
	return {
		type: 'CURRENCY_LOADED',
		payload: currency,
		val: v2
	};
};

const convertibleCurrency = (code, value) => {
	return {
		type: 'CONVERTIBLE_CURRENCY',
		code,
		value
	};
}

const newValue2 = (val2) => {
	return {
		type: 'VAL_2',
		payload: val2
	};
};

export {
	currencyLoaded,
	convertibleCurrency,
	newValue2
};
